import React from 'react';
import { Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown'


const navheader = () => {
    return (
        <>
            <Container className='nav-color' fluid>
                <Navbar fixed='sticky' expand="lg" className="bg-body-tertiary">
                    <Container>
                        <Navbar.Brand href="#home" className='Nav-text'>TeamUP</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Nav className="ml-auto">
                            <NavDropdown title="Menu" id="basic-nav-dropdown" className='Nav-text'>
                                <NavDropdown.Item href="#action/3.1" className='Nav-text'>Action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2" className='Nav-text'>
                                    Another action
                                </NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3"className='Nav-text'>Something</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.4"className='Nav-text'>Separated link
                                </NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                    </Container>
                </Navbar>
            </Container>
        </>
    );
};

export default navheader;
